const Card =() => {
	return(
		<div className='bg-dark-green dib br4 pa2 ma2 grow shadow-7'> 
			<img alt='robots' src='https://robohash.org/random?50x50'/>
			<div>
				<h2>Jane Doe</h2>
				<p>jane.doe@gmail.com</p>
			</div>
		</div>
		);
}

export default Card;
